import datetime
import heapq

def cookies4(k, A):
    # Write your code here
    A.sort()
    iterations = 0
    while len(list(filter(lambda x: x < k, A))) > 0 and len(A) >= 2:
        least = min(A)
        A.remove(least)
        second_least = min(A)
        A.remove(second_least)
        A.append(least + 2*second_least)
        iterations += 1
    #     print(least, second_least)
    # print(A, iterations)
    
    return -1 if len(A) == 1 and A[0] < k else iterations

def cookies3(k, A):
    # Write your code here
    iterations = 0
    while len(list(filter(lambda x: x < k, A))) > 0 and len(A) >= 2:
        A.sort()
        least = A[0]
        second_least = A[1]
        A.remove(least)
        A.remove(second_least)
        A.append(least + 2*second_least)
        iterations += 1
    #     print(least, second_least)
    # print(A, iterations)
    
    return -1 if len(A) == 1 and A[0] < k else iterations

def cookies(k, A:list):
    # Write your code here
    A.sort()
    sub = [x for x in A if x < k]
    cut = len(sub)
            
    iterations = 0
    
    while len(sub) >= 2:
        sub.sort()
        least = sub[0]
        second_least = sub[1]
        sub.remove(least)
        sub.remove(second_least)
        result = least + 2*second_least
        if result < k:
            sub.append(result)
        else:
            if result == k:
                A.insert(cut, result)
            else:
                A.append(result)
        iterations += 1
    # print(sub)
    if len(sub) == 0:
        return iterations
        
    elif sub[0] < k and len(A) > cut:
        return iterations + 1
    
    return -1

def cookies_with_heap(k, A:list): # only way i could pass exceution times in HR
    heapq.heapify(A) # create a priority queue, will keep track of the list sorted

    iterations = 0
    while len(A) >= 2:
        least = heapq.heappop(A) # pop the least value, removes A[i] from the list
        if least >= k:
            return -1 if iterations == 0 else iterations # if least >= k we are done, return -1 if no iteration where done else return # of iterations
        second_least = heapq.heappop(A) # pop again the least value, removes A[i] from the list
        heapq.heappush(A, least + 2*second_least) # push the result in to the list/heapq
        iterations += 1

    return -1 if A[0] < k and len(A) == 1 else iterations # if len(A) == 1 and A[0] < k means there was no answer, else return # of iterations



